**To Reproduce**
I've compare inference time with my own model in caffe and onnxruntime.
My model contains conv, slice, eltwise, pool layers.
And caffe always give better inference speed.

Following is the code I used on onnxruntime.
`OrtEnv* env;
	CHECK_STATUS(OrtCreateEnv(ORT_LOGGING_LEVEL_WARNING, "test", &env));
	// initialize session options if needed
	OrtSessionOptions* session_option = OrtCreateSessionOptions();

	OrtSessionOptionsAppendExecutionProvider_CUDA(session_option, 0);
	OrtSetSessionThreadPoolSize(session_option, 1);

	//*************************************************************************
	// create session and load model into memory
	OrtSession* session;
	const wchar_t* model_path = L"d:\\model.onnx";
	CHECK_STATUS(OrtCreateSession(env, model_path, session_option, &session));`

And rest part is same as sampleMnist.
Aren't there any other options to improve performance?
Hope any suggestions.

**Describe the bug**
I was trying to load and run onnx model which was converted from Scikit learn with OnnxMLTools python. But when loading the model, I got "Attempted to read or write protected memory. This is often an indication that other memory is corrupt." Below is stack info.

